import React, { Component } from 'react';
import axios from 'axios';
import { Container, Row, Col } from 'reactstrap';

import { List1 } from './styles';

import MUIDataTable from "mui-datatables";


const columns = ["Estado", "Cidade", "Data", "Casos Confirmados","Mortes"];



const Lista = props => (
  <tr>
    <td>{props.lista.state}</td>
    <td>{props.lista.cidade}</td>
    <td>{props.lista.data}</td>
    <td>{props.lista.casos}</td>
    <td>{props.lista.mortes}</td>
    
  </tr>
)
const options = {
    filterType: 'checkbox',
  };

export default class FeedbackList extends Component {
  constructor(props) {
    super();

    this.state = {listas: []};
  }

  componentDidMount() {
    axios.get('http://localhost:5000/lista_diaria/')
      .then(response => {
        this.setState({ listas: response.data })
      })
      .catch((error) => {
        console.log(error);
      })
  }

  
  listaCovid() {
    return this.state.listas.map(currentmapalistdiario => {
      return <Lista lista={currentmapalistdiario} key={currentmapalistdiario._id}/>;
    })
  }

  render() {
    return (
      <div>
        <List1>
        <h3>Casos Diarios</h3>
          </List1>
      <Container className="themed-container" fluid={true}>
        <Row>
        <Col>
        <table className="table">
          {/* <thead className="thead-light">
            <tr>
              <th>Estado</th>
              <th>Cidade</th>
              <th>Data</th>
              <th>Casos Confirmados</th>
              <th>Mortes</th>
            </tr>
          </thead> */}
          <tbody>
            <MUIDataTable columns={columns}>{ this.listaCovid() }</MUIDataTable>
          </tbody>
        </table>
        </Col>
        </Row>
      </Container>
      </div>
    )
  }
}
